import React from 'react';
import { Button, Form, FormGroup, Label, Input } from 'reactstrap';

class CreateMarket extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            marketName:"",
            address:"",
            size:""
        };
    }

    componentDidUpdate() {
        fetch('http://localhost:3000/log/api/log', {
            method: 'POST',
            body: JSON.stringify( {marketName: marketName, address: address, size: size}),
            headers: new Headers({
                'Content-Type': 'application/json',
                'Authorization': props.token
            })
        }).then ( (res) => res.json())
        .then ( (logData) => {
            console.log(logData);
            this.setState({
                marketName: marketName,
                address: address,
                size: size
            })
        })
    }
    render() {
        return (
            <>
                <h3>Log a Workout</h3>
                <Form onSubmit={handleSubmit}>
                <FormGroup>
                        <Label htmlFor="marketName" />
                        <Input name="marketName" value={marketName} onChange={(e) => this.setState(e.target.value)} />
                    </FormGroup>
                    <FormGroup>
                        <Label htmlFor="address" />
                        <Input name="address" value={address} onChange={(e) => this.setState(e.target.value)} >
                        </Input>
                    </FormGroup>
                    <FormGroup>
                        <Label htmlFor="size" />
                        <Input name="size" value={size} onChange={(e) => this.setState(e.target.value)} />
                    </FormGroup>
                    <Button type="submit">Click to Submit</Button>
                </Form>
            </>
        )
    }
}

export default CreateMarket;
